import React from "react";

const Map = () =>{
    return(
        <div className="map-container">
           <h1>maps</h1>
           <iframe title='maps' src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d124088.04713657436!2d16.22143811918436!3d63.903779234083714!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x467a9c4e07371da9%3A0xa03450952110050!2s880%2051%20Ross%C3%B6n%2C%20Sweden!5e0!3m2!1sen!2sin!4v1613819512415!5m2!1sen!2sin" 
           style={{width:"1321px", height:"750px", style:"border:0"}} allowfullscreen="" loading="lazy"></iframe>
        </div>    
    );
}

export default Map;
